def createList2D(lis1,lis2):
    datalist2D=[]
    for i in range(lis1):
        temp=[]
        for j in range(lis2):
            inp=int(input(f'llist [{i},{j}] : '))
            temp.append(inp)
        datalist2D.append(temp)
    return datalist2D
  
